CREATE TRIGGER `trg_copy_comprovante_after_update` AFTER UPDATE ON `vendas` FOR EACH ROW BEGIN
  IF OLD.comprovante IS NULL AND NEW.comprovante IS NOT NULL THEN
    UPDATE pedidos_diarios
       SET comprovante = NEW.comprovante
     WHERE id = NEW.id;
  END IF;
END
$$
